import styled from '@emotion/styled'
import axios from "axios";
import { useState } from 'react';
import IconButton from '@mui/material/IconButton';
import SkipNextIcon from '@mui/icons-material/WhatsApp';
import Delete from '@mui/icons-material/Delete';
import SkipPreviousIcon from '@mui/icons-material/Email';
import overview from '../src/images/overview2.jpeg'

const baseURL = "https://tennis4you-heroku.herokuapp.com/contacts";

const Section = styled.section`
  background: #f5bb00;
  color: #000000;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 10px;
`

let posts = [] as any;
const cards = [1, 2, 3];

const theme = createTheme();

export default function Contacts() {
  const [results, setResults] = useState<any[]>([]);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      axios.defaults.headers.post['Access-Control-Allow-Origin'] = '*';

      let resposta
      Object.keys(response.data).map(function(key, index) {
      resposta = {...response.data}
      posts.push(response.data[key])
     // console.log(key, index, response.data[key].email)
      });     

    //   console.log(posts)
       setResults(posts)
    });
  }, []);


  console.log(results)

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <main>

    <Section>

    <Grid container spacing={4}>
            {results?.map((result) => (

              <Grid
              item
              key={result._id}
              xs={12}
              md={4}
            >

      <Card >
      <CardContent sx={{ alignItems: 'center'}}>

        <Typography variant="h5" fontWeight={500} fontSize={18} component="div">
        {result.name}
        </Typography>

        <Typography variant="body2">
        {result.name}
          <br />
        </Typography>

      </CardContent>
      <Box sx={{ display: 'flex', alignItems: 'center', pl: 1, pb: 1 }}>
          <IconButton>
           <SkipNextIcon />
          </IconButton>        
          <IconButton>
           <SkipPreviousIcon /> 
          </IconButton>
          <Box sx={{ display: 'flex', alignItems: 'left', pl: 1, pb: 1 }}>
          <IconButton>
           <SkipNextIcon />
          </IconButton>        
          <IconButton>
           <SkipPreviousIcon /> 
          </IconButton>
        </Box>
        </Box>
      {/* <CardActions>
        <Button size="small">Learn More</Button>
      </CardActions> */}
    </Card>
              </Grid>
            ))}
          </Grid>




    </Section>
      </main>
      {/* End footer */}
    </ThemeProvider>
  );
}
